(1, 71, 'Actividades desarrolladas', '1. Reunión con el líder : Gobernador arhuaco, sr. José María Arroyo Izquierdo, se explica el motivo de la reunión y los procedimientos a seguir para la firma de la prorroga y entrega de cuenta de cobro.\r\n2.Se recibe el informe de ejecución financiera por ', 'ylinaresm@dane.gov.co', '2016-12-06 19:48:11'),
(2, 146, 'Toma mejor decisiones', 'Las personas que toman decisiones deberian tener la oportunidad de hacer trabajo de campo, ello le permitira tomar mejores desiciones .', '', '2016-12-22 19:58:09'),
(3, 82, 'Comision_en_la_ciudad_de_Pereira.docx', 'Me permito informar que el día 21 de noviembre de 2016 estaré en Comisión en la ciudad de Pereira. Teniendo en cuenta que por motivos familiares voy a desplazarme a la ciudad de Pereira el día sábado 19 de Noviembre antes del inicio la Comisión, asumo la ', 'cosoriog@dane.gov.co', '2016-12-26 14:00:24'),
(4, 126, 'COMISION DEL 5 AL 7 DICIEMBRE ', 'La comisión fue realizada del 05 al 7 de diciembre de 2016', 'gamunozp@dane.gov.co', '2016-12-26 15:14:35'),
(5, 42, 'Observación', 'El pasabordo de ida a Cali aparece con fecha de 16 de noviembre, debido a que está relacionado con una comisión en la que me encontraban y se me pide permanecer en Cali para asistir a otra reunión el día 21. Teniendo en cuenta que no se me amplió la infor', 'eardilas@dane.gov.co', '2016-12-27 18:30:04'),
(6, 160, 'Regresé de la comisión dos (2) días después sin que la Entidad incurriera en gastos adicionales. (Por mi cuenta propia)', 'Regresé de la comisión dos (2) días después sin que la Entidad incurriera en gastos adicionales. (Por mi cuenta propia)', 'lcastanoc@dane.gov.co', '2017-01-02 19:41:16'),
(7, 160, 'Regresé de la comisión dos (2) días después sin que la Entidad incurriera en gastos adicionales. (Por mi cuenta propia)', 'Regresé de la comisión dos (2) días después sin que la Entidad incurriera en gastos adicionales. (Por mi cuenta propia)', 'lcastanoc@dane.gov.co', '2017-01-02 20:42:02'),
(8, 271, 'aprobado', 'aprobado', 'caladinoc@dane.gov.co', '2017-01-31 20:37:24');
