(58, 4, '2017-01-17 21:50:30', 'jmendozab', 'Por no tener respuesta en solicitud al correo del 12/01/2017, se devuelve esta legalización.\r\nDe: Jeannette Mendoza Bautista [mailto:jmendozab@dane.gov.co] \r\nEnviado el: jueves, 12 de enero de 2017 01:00 p.m.\r\nPara: Miryam Fernanda Cuenca \r\nCC: \'jagonzalez@dane.gov.co\'; Edgar Eduardo Huertas Piragauta; Jorge Cabezas Zabala; \'eardilar@dane.gov.co\'\r\nAsunto: Legalización comisiones con inconsistencias.\r\nImportancia: Alta\r\n\r\nBuenas tardes:\r\n\r\nTeniendo en cuenta que por el sistema estoy revisando 3 legalizaciones de comisiones de JORGE CABEZAS ZABALA P.E.2028-14, de la Dirección de Censos y Demografía veo inconsistencia en la diferencia de sueldo de $705.010  de una comisión a otra  y por lo tanto diferencia en el día de viáticos a liquidar de $50.340, según liquidación de ustedes mismos (creo que están mal liquidados los valores de las dos últimas legalizaciones);  por favor me pueden aclarar este punto?.\r\n\r\n1.	Legalización comisión 1843-2335  del 19 al 20 de noviembre sueldo $3.205.872 $220.349 día viáticos, además faltan recibos de transporte terrestre.\r\n2.	Legalización comisión 1867-2364  del 22 al 23 de noviembre sueldo $2.500.862 $170.009 día viáticos\r\n3.	Legalización comisión OD 1873 – 2368 del 24 al 26 de noviembre sueldo $2.500.862 $170.009 día viáticos\r\n\r\nQuedamos atentos,\r\n\r\n'),
