(82, 2, '2016-12-09 21:01:20', 'rrvalenzuelag', 'Cumple con lo establecido'),
(82, 2, '2016-12-26 14:15:45', 'rrvalenzuelag', 'La funcionaria Carolina Osorio informa que "el día 21 de noviembre de 2016 estuvo en Comisión en la ciudad de Pereira y que por motivos familiares se iba a desplazar desde el día sábado 19 de Noviembre antes del inicio la Comisión, asumiendo la responsabilidad frente a cualquier situación, así mismo los gastos por penalización de cambio de fecha y  horario de tiquetes." Este reporte se adjunta en informe de comisión según solicitud de GTH.'),
(82, 3, '2016-12-20 16:24:15', 'eehuertasp', '\nMe permito informar que la comisión No  1756 a la ciudad de Pereira entre el 21  de noviembre de 2016 fue devuelta por qué  se adjunto un pasabordo de IDA de fecha 19 de noviembre y no se especifica el motivo por que el funcionario viajo 2 días antes , agradezco adjuntar en el informe una nota que especifique que:” el vuelo de IDA fue cambiado por motivos personales y que este cambio no genero gastos adicionales a la entidad”,  luego envíar nuevamente la corrección por el aplicativo somos dane.'),
(82, 3, '2016-12-26 20:29:59', 'eehuertasp', 'la comisión se legalizo fisicamente'),
